(window.webpackJsonp=window.webpackJsonp||[]).push([[10],{22:function(e){e.exports=JSON.parse('{"pages-about-a":"世界各地的 FCC 社区","pages-about-b":"关于我们","pages-about-c":"为什么加入我们?","pages-about-d":"FCC 上海社区是一个传承了 FCC 全球社区“倡导人人皆可编程”思想，面向上海所有想要学习编程、对计算机编程感兴趣，以及那些想要通过编程找到一份满意工作的学生以及社会群众的、免费的公益性开发者社区。截止目前，社区微信群人数已有400余人，是社区成员们作为日常交流, 技术学习的公共线上平台。","pages-about-e":"社区整体运营主要以线上即时交流、课程学习与线下活动三种方式相互结合。我们希望所有 FCC 社区的小伙伴能够在学习知识的同时也能够在这个过程中找到意气相投的伙伴，在职业生涯的路上可以一起前进。","pages-about-f":"freeCodeCamp.org 是一个注册在美国的非营利组织，创立于 2014 年，以“帮助人们免费学习编程”为使命，创建了大量免费的编程教程。我们的线下开发者社区遍布全球160多个国家、2000多个城市。在这里，你可以和社区的小伙伴一起开启全新的编程学习之路。我们正在帮助全球数百万人学习编程，其中有数千人由此找到了他们的第一份软件开发者工作，改善了他们的事业和生活。","pages-about-g":"创始人 Quincy Larson 曾是美国一所大学的校长，自学编程后用程序让自己的工作更为高效。后来他从大学辞职后成为一名开发者，随即创立 freeCodeCamp，希望为想转型成为开发者或者对编程感兴趣的人们带来免费的、优质的学习资源。目前 freeCodeCamp 的全职团队有 7 人，分别来自美国、英国、中国、波兰、印度、韩国、土耳其，线上远程协作。除了 Quincy 以外，6 名全职员工最初都是 freeCodeCamp 社区中活跃的志愿者，利用业余时间为社区做贡献。同时，我们拥有成千上万名活跃的开源贡献者帮助我们去践行社区的使命。","pages-contributors-a":"社区贡献者","pages-contributors-b":"如何成为一名贡献者","pages-contributors-c":"FCC 上海社区绝不将社区志愿者的贡献做量化, 上述排列仅为参与先后顺序。","pages-contributors-d":"成为一位项目贡献者非常简单, 这里有一个链接, 相信你能在里面找到你想要的答案。","pages-achievement-a":"迄今完成的成就","pages-achievement-b":"... 更多活动，敬请关注 ..."}')}}]);